import React from 'react'
import styled from "styled-components";
import myimage from "./images/download (1).jpg"

function Testinimial() {
    return (
        <div>
            <TestWraper>
                <h1>HIDING IN PLAIN SIGHT</h1>
                <P>With a small footprint and elegant design, The Mirror blends seamlessly into your home. All you need is two feet of wall space to turn any room into a complete home gym.With a small footprint and elegant design, The Mirror blends seamlessly into your home. All you need is two feet of wall space to turn any room into a complete home gym.</P>
                <Button type="button" class="btn btn-dark">HOW IT WORKS</Button>
                <IMG src={myimage} alt="testinomials.png">
                </IMG>
            </TestWraper>
        </div>
    )
}

export default Testinimial

const TestWraper = styled.div
`text-align:center;
padding:150px 150px;
float:left;
text-align: justify;
box-sizing: border-box;
`
const Button = styled.button
`background: none;
border-width: 2px;
border-radius: 2px;
border-style: solid;
border-color: #2b2b2b;
color: #2b2b2b;
padding: 1rem 2rem;
min-width: 16rem;
text-transform: uppercase;
transition: all 200ms ease;
text-decoration: none;
letter-spacing: 3px;
font-size: 1rem;
`

const IMG = styled.img

`position:
float:right;
height:40%;
width:40%;
margin:0;
`

const P = styled.p
` line-height:2;
  display: block;
  margin-block-start: 1em;
  margin-block-end: 1.5em;
  margin-inline-start: 0px;
  margin-inline-end: 600px;
  text-align:left;
  text-align:justify;
`
